import React, { Component } from 'react';

class CycleC extends Component {
    render() {
        return (
            <ul>
            <div className='container'
                 style={{display: this.props.isToggle? 'block' : 'none'}}>
                    <div>40% Warmup Set 1 x 5 : {Math.round((weight-bar)*4/10).toFixed(1)}{mass}</div>
                    <div>50% Warmup Set 2 x 5 : {Math.round((weight-bar)*5/10).toFixed(1)}{mass}</div>
                    <div>60% Warmup Set 3 x 3 : {Math.round((weight-bar)*6/10).toFixed(1)}{mass}</div>
                </div>


                <div>75% Working Set 1 5x {Math.round((this.props.weight-this.props.bar)*75/100).toFixed(1)}kg</div>
                <div>85% Working Set 2 3x {Math.round((this.props.weight-this.props.bar)*85/100).toFixed(1)}kg</div>
                <div>95% Working Set 3 1x+ {Math.round((this.props.weight-this.props.bar)*95/100).toFixed(1)}kg</div>
            </ul>
            )
    }
}

export default CycleC;
